import React from 'react';
import logo from './logo.svg';
import './App.css';

function handleClick() {
  console.log('Botão funcionando!')
}

class App extends React.Component {
  render () {
    return <div>
        <button onClick={handleClick}>Primeiro botão</button>
        <button onClick={handleClick}>Segundo botão</button>
        <button onClick={handleClick}>Terceiro Botão</button>
    </div>
  }
}

export default App;
